description:
For your convenience, I separated this from a discography torrent I found elsewhere on TPB.
It was marked there as Disc 1 of the &quot;Teaching An Oakie To Fly&quot; bootleg (that is, teaching Oklahoma native Steve Gaines to become a Free Bird.)

Disc 2 contains rehearsal footage as well as a pre-Skynyrd Gaines bootleg. That's likely going to be my next upload.

This is Lynyrd Skynyrd's set from their 1976 performance at Knebworth.

Artist: &quot;Lynyrd Skynyrd&quot;
Album: &quot;1976.08.21 - Knebworth England&quot;
Genre: &quot;Southern Rock&quot;
Date: &quot;1976&quot;

Brilliant stuff, plain and simple. Enjoy.
